import React, { useState, useEffect } from 'react';
import MainNavBar from '../Components/Common/MainNavBar';
import AxiosInstance from '../config/AxiosInstance';
import { useParams } from 'react-router-dom';
import { BASE_URL } from '../Constants/constants';
import TimeSlotModal from './Common/Modal';

const CourtBooking = () => {
  const [singleCourtData, setSingleCourtData] = useState({});
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [timeslot, setTimeslot] = useState('');
  const { id } = useParams();

  useEffect(() => {
    getSingleCourtData();
  }, []);

  const getSingleCourtData = () => {
    AxiosInstance.get('users/getSinglecourtData', { params: { courtId: id } })
      .then((res) => {
        setSingleCourtData(res.data);
      })
      .catch((err) => {
        console.log('Error in getting the data of a single court', err);
      });
  };

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };

  const handleAddTimeSlot = () => {
    if (!timeslot.trim()) {
      alert('Please enter a valid time slot');
      return;
    }

    console.log('Adding time slot:', timeslot);

    closeModal();
  };

  return (
    <>
      <div className='single-court-img-box'>
        <img src={`${BASE_URL}/courts/${singleCourtData?.courtImage}`} alt="" />

        <div className='court-Name'>
          <h3>{singleCourtData?.courtName}</h3>
          <input
            type="text"
            placeholder="Enter time slot"
            value={timeslot}
            onChange={(e) => setTimeslot(e.target.value)}
          />
          <button onClick={openModal}>Add Time Slot</button>
        </div>
      </div>
<div className='d-flex'>
    <marquee
    behaviour="scroll"
    direction="right"
    className="rolling-booking"

>
<h3 className='"d-inline'>confirm your slot at the earlir</h3>
</marquee>
</div>
<div className='container-fluid mt-5'>
    <div className='row-justify-content-center'>
        <div className='col-md-6 col-lg-3 col-12 border border-1 rounded-2'>
            <div className='date-picker'>
                <span>1-2pm</span>
                <span>1-2pm</span>
                <span>1-2pm</span>
                <span>1-2pm</span>
                <span>1-2pm</span>
                <span>1-2pm</span>
                <span>1-2pm</span>
</div>
<button className='btn btn-primary w-100 mt-5 border'>
    {" "}
    book now{" "}
</button>
            </div>
        </div>
    </div>


      {/* TimeSlotModal */}
      <TimeSlotModal
        isOpen={isModalOpen}
        onRequestClose={closeModal}
        contentLabel="Add Time Slot Modal"
      >
        <h2>Add Time Slot</h2>
        <label htmlFor="timeslot">Time Slot:</label>
        <input
          type="text"
          id="timeslot"
          value={timeslot}
          onChange={(e) => setTimeslot(e.target.value)}
        />
        <button onClick={handleAddTimeSlot}>Add</button>
        <button onClick={closeModal}>Cancel</button>
      </TimeSlotModal>
    </>
  );
};

export default CourtBooking;
